query:
query {
	people(
		first: 20
		filter: {
			createdAt: { greaterThanOrEqualTo: "2002-11-05T02:36:53.1694177+01:00" }
			disabled: false
			account: {negate:true values: [""]}
		}
		view: all_with_roles
		order: { field: createdAt direction:asc }
	) {
		nodes {
			id
			name
			account {
				id
			}
			teams(first: 100) {
				nodes {
					createdAt
					disabled
					name
					updatedAt
					id
					account {
						name
						id
					}
				}
				pageInfo {
					endCursor
					hasNextPage
				}
			}
			configurationItems(first: 20) {
				nodes {
					id
					account {
						name
						id
					}
					users(first: 100) {
						nodes {
							name
							createdAt
							primaryEmail
							id
							account {
								name
								id
							}
						}
						pageInfo {
							endCursor
							hasNextPage
						}
					}
				}
				pageInfo {
					endCursor
					hasNextPage
				}
			}
		}
		pageInfo {
			endCursor
			hasNextPage
		}
	}
}
